// src/pages/Logout.jsx
import { useEffect } from 'react'
import { useNavigate } from 'react-router-dom'

const Logout = () => {
  const navigate = useNavigate()

  useEffect(() => {
    console.log('Log: Kullanıcı çıkış yaptı (LO)')
    localStorage.clear()
    navigate('/')
  }, [navigate])

  return null
}

export default Logout
